        <b><a href="/65432987655">Home</a></b>
        <h1><u>Full Database</u></h1>
        <ul id="databaseList"></ul>
        <div style="position:fixed; left:0; bottom:0; font-weight: bold;">

        </div>

    </body>
    <script>
        //Normal async - await function 
        //1. Grabs data from backend
        //2. Displays it on the frontend (with any manipulation)
        async function getData(){
            try{
                const response = await fetch("/databasePull");
                if (response.ok){
                    const text = await response.text();
                    const element = document.getElementById('databaseList');
                    textArray = text.split(",");
                    // element.innerHTML = textArray[1];
                    //attaching each table name to the dom and adding link
                    textArray.forEach( function(table){
                        let x = document.createElement('a');
                        x.setAttribute('href', `/test?name=${table}`);
                        x.textContent = table;
                        x.style.fontWeight = 'bold';
                        //x.style.fontSize = '23px'

                        const listItem = document.createElement('li');
                        listItem.appendChild(x);
                        element.appendChild(listItem);


                        //element.appendChild(x);
                    }) 
                
                } 
                else{
                    throw new Error('Failed to fetch data');
                }
            }
            catch (error){
                console.log('Error:', error);
            }
    }    
    getData();
    //hides the real path so users cannot access without logging in first
    history.replaceState({}, '', '/DataDump');


    </script>
